import React from "react";
import Typewriter from "typewriter-effect";
import "./home.css";
import { motion } from "framer-motion";

function home() {
  return (
    <div className="container1">
      <motion.h1
        initial={{ color: "white", opacity: 0 }}
        animate={{ color: "black", scale: "1.3", opacity: 1 }}
        transition={{ delay: 1.5, duration: 1.5 }}
      >
        Hello Everyone I am Anish Kumar Singh
      </motion.h1>
      <p className="intro">
        I am a Second Year CSE Undergrad at BIT MESRA.I like to explore all
        domains and learn new stuffs. My Hobbies Include Playing Table Tennis
        and Volleyball
      </p>
      <div className="typer">
        <Typewriter
          onInit={(typewriter) => {
            typewriter
              .typeString("Learner")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Programmer")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Developer")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Data Structures Enthusiast")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Developer")
              .pauseFor(2500)
              .deleteAll()
              .start();
          }}
        />
      </div>
    </div>
  );
}

export default home;
